import { makeStyles } from '@material-ui/core/styles';
import './shop.css';


export default function Tile(image, text, price) {

  return (
    <div className="tile">
      <img className="image" src={Tile.image}></img>
      <div className="text"><span>{Tile.text}</span></div>
      <div className="price">{Tile.price}</div>
    </div>
  );
}
